package gcom.gui.atendimentopublico;import javax.servlet.http.HttpSession;import org.apache.struts.action.ActionError;import org.apache.struts.action.ActionErrors;import org.apache.struts.validator.ValidatorActionForm;public class GerarCertidaoNegativaActionForm extends ValidatorActionForm {	private static final long serialVersionUID = 1L;	private String idImovel;	private String matriculaImovel;	private String enderecoImovel;	private String cpfCnpj;	private String nomeClienteUsuario;		private static final String ATRIBUTO_CLIENTE_IMOVEIS = "clienteImoveis";	public String getIdImovel() {		return idImovel;	}	public void setIdImovel(String idImovel) {		this.idImovel = idImovel;	}	public String getMatriculaImovel() {		return matriculaImovel;	}	public void setMatriculaImovel(String matriculaImovel) {		this.matriculaImovel = matriculaImovel;	}	public String getEnderecoImovel() {		return enderecoImovel;	}	public void setEnderecoImovel(String enderecoImovel) {		this.enderecoImovel = enderecoImovel;	}	public String getCpfCnpj() {		return cpfCnpj;	}	public void setCpfCnpj(String cpfCnpj) {		this.cpfCnpj = cpfCnpj;	}	public String getNomeClienteUsuario() {		return nomeClienteUsuario;	}	public void setNomeClienteUsuario(String nomeClienteUsuario) {		this.nomeClienteUsuario = nomeClienteUsuario;	}		public void reset(HttpSession sessao) {		this.matriculaImovel = null;		this.cpfCnpj = null;		this.nomeClienteUsuario = null;		this.enderecoImovel = null;		sessao.removeAttribute(ATRIBUTO_CLIENTE_IMOVEIS);	}		}